{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ariacs/bellabeat-health-tracker-case-study?scriptVersionId=98948771\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"1450b4ca","metadata":{"papermill":{"duration":0.184299,"end_time":"2022-06-21T12:21:55.575065","exception":false,"start_time":"2022-06-21T12:21:55.390766","status":"completed"},"tags":[]},"source":["# How Can a Wellness Technology Company Play It Smart?\n","<br>\n","\n","![](https://images-na.ssl-images-amazon.com/images/I/51oDKT08VxL.jpg)\n","<br>\n","\n","# Summary\n","\n","Bellabeat, a high-tech manufacturer of health-focused products for women, has the potential to become a larger player in the global smart device market. Currently, Bellabeat offers different smart device trackers that collect data on activity, sleep, stress, and reproductive health. Bellabeat’s cofounder and Chief Creative Officer, Urška Sršen, has chosen a particular Fitbit dataset for me to analyze in order to reveal more opportunities for business growth.  \n","<br>  \n","\n","#### Business Task  \n","  \n","  \n","*\tAnalyze Fitbit data to gain insight into how consumers use              non-Bellabeat smart devices\n","* Select one Bellabeat product and apply these insights into a               presentation\n","*\tProvide high-level recommendations for Bellabeat’s marketing strategy\n","<br> \n"," \n","#### Questions for the Analysis\n","\n","*\tWhat are some trends in smart device usage?\n","*\tHow could these trends apply to Bellabeat customers?\n","*\tHow could these trends help influence Bellabeat’s marketing strategy?  \n","<br>\n","\n","\n","#### Stakeholders\n","\n","*\t**Urška Sršen:** Bellabeat’s cofounder and Chief Creative Officer \n","*\t**Sando Mur:** Mathematician and Bellabeat’s cofounder \n","*\t**Bellabeat Analytics Team**\n","<br>\n","<br>\n","\n","# Preparing the Data\n","\n","Source Used: [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) (CC0: Public Domain Kaggle dataset made available through Mobius, 04.12.2016-05.12.2016).  \n","[Original Source:](https://zenodo.org/record/53894#.Ybzqy9nMK8X) Furberg, R., Brinton, J., Keating, M., & Ortiz, A. (2016). Crowd-sourced Fitbit datasets 03.12.2016-05.12.2016 Zenodo. \n","\n","**Thirty** eligible Fitbit users consented to the submission of personal tracker data over a **31 day** period. The **18 csv file** dataset includes information about daily activity, steps, heart rate, and time asleep that can be used to explore user habits.  \n","<br>\n","\n","\n","#### Data Limitations\n","     \n","*\tSample size of 30 participants is not an ideal representation of user population\n","*\tDemographic data of participants are not given (Bellabeat’s customers are women) \n","*\tHealth background of participants unknown\n","*\tTime period of data collection is only 31 days: 4/12/16 – 5/12/16\n","*\tData collection is from 2016 (6 years ago)\n","*\tDataset is from a third-party provider (Amazon Mechanical Turk)\n","\n","Overall, the datasets used in this analysis are of low integrity, but for the purpose of this case study, I'll focus on the business task and each phase of the data analysis process. \n","<br>\n","<br>\n","\n","#### SQL Data Verification and Chosen Datasets (3):\n","\n","I explored each file initially in SQL and was able to determine the datasets that would be most beneficial for the analysis. Utilizing SQL before importing the datasets into R, allowed me to gain better insight on how to clean and organize the data before processing it into RStudio Cloud.   \n","<br>\n","<br>\n","**1)\tdaily_activity_merged:** this dataset is the master file including: calories, intensities, daily steps, and distance. I was able to exclude other files containing identical attributes.\n","\n","    #verify number of unique ids and start/end dates of tracked data\n","\n","    SELECT DISTINCT Id  \n","    FROM fitabase_data.daily_activity_merged  \n","\n","    = 33 (more Ids than the 30 consented participants – will check for duplicates in R)\n","\n","    SELECT MIN(ActivityDate) AS StartDate, MAX(ActivityDate) AS EndDate  \n","    FROM fitabase_data.daily_activity_merged\n","\n","    startDate = 2016-04-12  EndDate = 2016-05-12 (correct length of study dates)\n","<br>\n","\n","**2)\tsleep_day_merged:** this table is not included in the daily_activity_merged master file which contains participant time asleep and awake.  \n","\n","    SELECT DISTINCT Id. \n","    FROM fitabase.data.sleep_day_merged\n","\n","    = 24 (only 24 of 30 participants tracked their sleep data – not ideal, but I'll include this dataset to identify any trends).  \n","\n","    SELECT MIN(SleepDay) AS StartDate, MAX(SleepDay) AS EndDate \n","    FROM fitabase_data.sleep_day_merged\n","\n","    StartDate = 2016-04-12 EndDate = 2016-05-12 (correct length of study dates)\n","<br>\n","\n","**3)\thourly_steps_merged:** I decided to explore this dataset in order to gain insight on the most sedentary and active times of day. This dataset is not included in the daily_activity_merged master file.\n","\n","    SELECT DISTINCT Id\n","    FROM fitabase.data.hourly_steps_merged\n","\n","    = 33 (more Ids than the 30 consented participants – will check for duplicates in R)\n","\n","    SELECT MIN(ActivityHour) AS StartDate, MAX(ActivityHour) AS EndDate\n","    FROM fitabase_data.hourly_steps_merged\n","\n","    StartDate = 2016-04-12  EndDate = 2016-05-12 (correct length of study dates)\n","<br>\n","\n","#### Excluded Datasets\n","\n","* weightlog_info_merged (contains only 8 participant data out of 30 – but important to note in analysis report)   \n","* Datasets including second and minute-level activity, hourly calories, and hourly intensities\n","*\tDatasets that are already included in the daily_activity_merged master file\n","<br>\n","<br>\n","\n","# Processing the Data in R\n","<br>\n","\n","#### Installed packages\n","\n","* tidyverse\n","<br>\n","* lubridate\n","<br>\n","* here\n","<br>\n","* skimr\n","<br>\n","* janitor\n","<br>\n","<br>"]},{"cell_type":"markdown","id":"d4f7df69","metadata":{"papermill":{"duration":0.171134,"end_time":"2022-06-21T12:21:55.924401","exception":false,"start_time":"2022-06-21T12:21:55.753267","status":"completed"},"tags":[]},"source":["#### Opening libraries"]},{"cell_type":"code","execution_count":1,"id":"11c17e45","metadata":{"execution":{"iopub.execute_input":"2022-06-21T12:21:56.276974Z","iopub.status.busy":"2022-06-21T12:21:56.275236Z","iopub.status.idle":"2022-06-21T12:21:57.651827Z","shell.execute_reply":"2022-06-21T12:21:57.650459Z"},"papermill":{"duration":1.553439,"end_time":"2022-06-21T12:21:57.652011","exception":false,"start_time":"2022-06-21T12:21:56.098572","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The