},"source":["# Bellabeat Insights"]},{"cell_type":"markdown","id":"11dc80bb","metadata":{"papermill":{"duration":0.272784,"end_time":"2022-06-21T12:22:37.902108","exception":false,"start_time":"2022-06-21T12:22:37.629324","status":"completed"},"tags":[]},"source":["![](https://images.indianexpress.com/2015/09/leaf_big_1.jpg)"]},{"cell_type":"markdown","id":"1f5783cc","metadata":{"papermill":{"duration":0.27525,"end_time":"2022-06-21T12:22:38.451396","exception":false,"start_time":"2022-06-21T12:22:38.176146","status":"completed"},"tags":[]},"source":["#### Product chosen: Bellabeat's **Leaf Urban**, a wellness tracker for women that tracks daily activity, menstrual cycles, meditation, stress-resistance, and sleep habits. It can be worn as a removable clip, bracelet, or necklace.  "]},{"cell_type":"markdown","id":"aaf89b50","metadata":{"papermill":{"duration":0.272996,"end_time":"2022-06-21T12:22:38.999052","exception":false,"start_time":"2022-06-21T12:22:38.726056","status":"completed"},"tags":[]},"source":["### How can these trends apply to Bellabeat customers?\n","<br>\n","\n","* Personalize fitness activity levels based on different forms of movement that’s best for the Bellabeat user on certain days. Create suggested workout schedules based upon a user's preferred time of day and activity level. Ex. 10 min yoga, strength training, running, or walking. **(Sedentary minutes vs. Daily Steps plot)**\n","<br>\n","\n","* If Bellabeat users want to increase their daily step count, allow them to set the frequency of reminders to support their movement goals throughout the days of the week. The more personalized the app can represent the customer’s wants and needs, the better. **(Hourly Steps Throughout The Day bar graph)**\n","<br>\n","\n","* Create daily, weekly, and monthly data summaries at the end of each day (to reinforce healthy daily habits), on Sundays (motivation for the week ahead), and at the end of every month to encourage, suggest improvement, and track progress overtime. Encourage app usage through wellness reminders and positive affirmations that help to motivate Bellabeat users during low usage days and before the week ahead. **(Frequency of App Usage bar graph)**\n","<br>\n","\n","* Allow Bellabeat users to choose their preferred activity level of the day depending on their fitness goals. If it’s to increase steps to burn more calories, the app can remind a user more frequently throughout the day to move and suggest their targeted caloric intake and expenditure for the day based on their health stats. **(Daily Steps vs. Calories Burned plot)**\n","<br>\n","\n","* Bellabeat can feature personalized app reminders to let users know their best time to wind down for sleep and wake-up cycles.\n","To increase usage, reinforce long battery life and comfort while wearing the device at night. Validate to potential customers Bellabeat consumer data that supports a better night’s sleep that can result in better [productivity levels, energy, alertness, etc]. Track light, deep, and REM sleep cycles. **(Minutes Asleep vs. Time in Bed plot)**"]},{"cell_type":"markdown","id":"d9d1a086","metadata":{"papermill":{"duration":0.274351,"end_time":"2022-06-21T12:22:39.550766","exception":false,"start_time":"2022-06-21T12:22:39.276415","status":"completed"},"tags":[]},"source":["# Marketing Strategy"]},{"cell_type":"markdown","id":"641be099","metadata":{"papermill":{"duration":0.27454,"end_time":"2022-06-21T12:22:40.099056","exception":false,"start_time":"2022-06-21T12:22:39.824516","status":"completed"},"tags":[]},"source":["*\t**Differentiate** Leaf Urban from the competition by primarily marketing its unique metrics made for women such as the benefits of tracking one’s **stress-resistance and menstrual cycles**, and secondary benefits of **creating healthier habits** through Bellabeat's daily activity tracker functions. Identify the main competition in each customer segment. \n","\n","*\t**Define the top 3 advantages** of data usage benefits for specific customer segments from baseline to product usage.  **“X% felt an increase in overall wellbeing, stress level, activity levels, energy, time asleep, or focus.”**\n","\n","*\t**Test + Learn:** run yearly product evaluations to learn which Bellabeat features are most beneficial, which ones aren't, and what can be improved. Set up periodic short customer surveys for feedback on Bellabeat products through the Bellabeat app.  \n","\n","*\t**Clearly articulate different customer segments** of women who are health motivated but want more sophisticated metrics in tracking their daily habits and wellbeing. Ex. highly stressed women who need wellness tracker support for sleep and hormonal changes vs. health motivated women who want to track daily activity levels and calories wearing a classic removable jewelry piece. Collect **demographic buyer data** to strengthen each marketing message.\n","\n","*\t**Invest in first-party data:** when a customer first downloads the Bellabeat App, give the user the option to 'opt-in' to collect usage data for research purposes that remains anonymous. **Reward Bellabeat customers who choose to opt into data collection** free personalized health coaching for a year (collect data during these sessions), gift cards, and discounts. Reinforce data privacy policies.\n","<br>\n","\n","**Bellabeat recommendations based on dataset limitations:**\n","\n","*\tLarger sample size (>100) for statistical significance\n","*\tPopulation of only females (Bellabeat’s target market) with baseline health and demographic data\n","*\t6-12+ months of data collection (enough length of time to account for seasonal and behavioral changes)\n","*\tCurrent data to reflect present consumer behaviors and trends\n","*\tIdeal: first party data representing consumer usage trends and feedback on Bellabeat’s products, features, and design.\n","<br>\n","<br>\n","\n","*Thank you for taking the time to read through this case study.*"]},{"cell_type":"markdown","id":"a7f415cc","metadata":{"papermill":{"duration":0.271059,"end_time":"2022-06-21T12:22:40.642447","exception":false,"start_time":"2022-06-21T12:22:40.371388","status":"completed"},"tags":[]},"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":49.298093,"end_time":"2022-06-21T12:22:41.028337","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-21T12:21:51.730244","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}